import React from 'react';

const DebugHeroTest = () => {
  return (
    <div style={{ 
      position: 'fixed', 
      top: '10px', 
      left: '10px', 
      background: 'rgba(0,0,0,0.8)', 
      color: 'white', 
      padding: '10px',
      borderRadius: '8px',
      zIndex: 9999,
      fontSize: '12px',
      maxWidth: '300px'
    }}>
      <h3>üîç Hero Image Debug</h3>

      {/* Test direct image */}
      <div style={{ marginBottom: '10px' }}>
        <strong>Direct Image Test:</strong>
        <img 
          src="https://images.unsplash.com/photo-1579952363873-27d3bfad9c0d?auto=format&fit=crop&w=400&q=80"
          alt="Direct test"
          style={{ width: '100%', height: '60px', objectFit: 'cover', marginTop: '5px' }}
          onLoad={() => console.log('‚úÖ Direct image loaded')}
          onError={() => console.log('‚ùå Direct image failed')}
        />
      </div>

      {/* Test local SVG */}
      <div style={{ marginBottom: '10px' }}>
        <strong>Local SVG Test:</strong>
        <img 
          src="/images/sports/hero-stadium.svg"
          alt="Local SVG test"
          style={{ width: '100%', height: '60px', objectFit: 'cover', marginTop: '5px' }}
          onLoad={() => console.log('‚úÖ Local SVG loaded')}
          onError={() => console.log('‚ùå Local SVG failed')}
        />
      </div>

      {/* Test fallback */}
      <div>
        <strong>Fallback Gradient:</strong>
        <div style={{ 
          width: '100%', 
          height: '60px', 
          background: 'linear-gradient(45deg, #3b82f6, #8b5cf6, #ef4444)',
          marginTop: '5px',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          color: 'white'
        }}>
          üèüÔ∏è Stadium
        </div>
      </div>
    </div>
  );
};

export default DebugHeroTest;
